import React from 'react';
import { Container, Typography, Button, AppBar, Toolbar, IconButton, Box, CssBaseline } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Menu as MenuIcon } from '@mui/icons-material';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function LandingPage() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            FlipVault
          </Typography>
          <Button color="inherit">Log in</Button>
          <Button variant="contained" color="primary">Get started for free</Button>
        </Toolbar>
      </AppBar>
      <Container maxWidth="lg" style={{ marginTop: '20px', textAlign: 'center' }}>
        <Typography variant="h3" gutterBottom>
          Accounting Software That Exceeds Expectations
        </Typography>
        <Typography variant="h5" gutterBottom>
          Built native to Stripe
        </Typography>
        <Box mt={4}>
          <Button variant="contained" color="primary" size="large" style={{ marginRight: '10px' }}>
            Get started for free
          </Button>
          <Button variant="outlined" color="inherit" size="large">
            Learn more
          </Button>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default LandingPage;
